style.css:
@-moz-document domain(jira.sygic.com) {
  .aui-header {
      background-color: #205081;
  }
  .aui-header .aui-button.aui-button-primary.aui-style {
      background-color: #3b7fc4;
  }
  .aui-header .aui-button.aui-button-primary.aui-style:hover,
  .aui-header .aui-button.aui-button-primary.aui-style:focus {
      background-color: #4796e6;
  }
  .aui-header a:hover,
  .aui-header a:focus {
      background-color: #296ca3;
  }
  .aui-header .aui-dropdown2-trigger:hover,
  .aui-header .aui-dropdown2-trigger:focus,
  .aui-header .aui-dropdown2-trigger.active {
      background-color: #296ca3;
  }
  .aui-list a.active,
  .aui-list .aui-list-item.active>a {
      background-color: #3b73af;
  }
  .aui-badge.vote-state-on,
  .aui-badge.watch-state-on {
      background-color: #3b73af;
  }
}
